import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
      <Header/>
      <Tecnologies/>
    </div>
  );
}

const Header = () => {
  return (
    <div>
      <a href='#s'>Home</a>
      <a href='#s'>New Feed</a>
      <a href='#s'>Massages</a>
    </div>
  );
}

const Tecnologies = () => {
  return (
    <div>
     <ul>
        <li> css </li>
        <li> html </li>
        <li> js </li>
        <li> react </li>
      </ul>
    </div>
  );
}

export default App;
